import React from 'react';
import ReactDOM from 'react-dom';
// src/index.js or src/App.js
import { ChakraProvider, ColorModeProvider, CSSReset } from '@chakra-ui/react';
import App from './App';

ReactDOM.render(
  <ChakraProvider>
    <ColorModeProvider>
      <CSSReset />
      <App />
    </ColorModeProvider>
  </ChakraProvider>,
  document.getElementById('root')
);
